import React from "react";
import BookingForm from "./BookingFrom";
import Footer from "./Footer";
import Hero from "./Hero";
import Nav from "./Nav";

const BookingPage = () => {
  return (
    <>
      <Nav />
      <Hero />
      <BookingForm />
      <Footer />
    </>
  );
};

export default BookingPage;
